import Link from 'next/link';
import Head from 'next/head';
import { Layout } from '../components/Layout';

const Index =() => {
    return(
        <Layout 
          mainTitle={'my page'} 
          footer={'this is written in nextjs'}
        >
            <Head>
                <title>home</title>
                <meta name="description" content="My SEO React app with nextjs" />
                <meta name="keywords" content="react next seo" />
                <meta name="author" content="koji kanao" />
                <link 
                  rel="stylesheet" 
                  href="https://unpkg.com/bootstrap-material-design@4.1.1/dist/css/bootstrap-material-design.min.css" 
                  integrity="sha384-wXznGJNEXNG1NFsbm0ugrLFMQPWswR3lds2VeinahP8N0zJw9VWSopbjv2x7WCvX" 
                  crossorigin="anonymous" 
                />
            </Head>
            <h2>hello world</h2>
            <Link href='/about'>
                <a>About</a>
            </Link>
            <p>
                demo text demo text demo text demo text demo text demo text demo text demo text demo text demo text
            </p>
        </Layout>
    )
}

export default Index;
